    getMenuList() {
        let strings = [];
        let MDMStrings = [];
        let menus = JSON.parse(JSON.stringify(this.dataService.menuitems));
        let MDMMenus = JSON.parse(JSON.stringify(this.dataService.MDMMenus));
        menus.forEach((menu) => {
            if (!menu.children) {
                if (menu.id !== "divider")
                    strings.push(menu.label);
            }
            else {
                let childItems = menu.children;
                childItems.forEach((cItem) => {
                    if (cItem.grandChildren) {
                        let gChildren = cItem.grandChildren;
                        gChildren.forEach((gc) => {
                            strings.push(gc.label);
                        });
                    }
                    else {
                        if (cItem.id !== "divider") {
                            strings.push(cItem.label);
                        }
                    }
                });
                strings.push(menu.label);
            }
        });
        MDMMenus.forEach((menu) => {
            if (!menu.children) {
                if (menu.id !== "divider")
                    MDMStrings.push(menu.label);
            }
            else {
                let childItems = menu.children;
                childItems.forEach((cItem) => {
                    if (cItem.id !== "divider") {
                        MDMStrings.push(cItem.label);
                    }
                });
                MDMStrings.push(menu.label);
            }
        });
    }
